import { useAuth } from './auth'
import { useNavigate } from 'react-router-dom'
function Logout(){
    const navigate = useNavigate()
    const auth = useAuth()
    const handleLogout = () => {
        auth.logout()
        navigate('/')
    }
    return(
        <>
        Welcome {auth.user}.<button onClick={handleLogout}>Logout</button>
        </>
        )
}
export default Logout
